window.bookSummaryJSON = "<p>In national award-winning author Darden North's debut novel, <i>House Call</i>, a police investigation into the murder of a young hospital nurse rips through a Mississippi community consumed in self-indulgence, reverse sexual discrimination, and cut-throat medical politics. Before a psychopath can be stopped, another will die.&nbsp;</p> <p>In <i>House Call</i>, Dr. Knox Chamblee joins a prominent medical clinic in a small southern town and soon finds himself the object of reverse sexual discrimination in the workforce. Worse yet, he is possibly a murder suspect.&nbsp;</p> <p>There are no real leads in the stabbing of nurse Taylor Richards until police uncover tire prints in a driveway that lead them to an answer in backwoods Mississippi.</p>"; 
